import { Injectable } from '@angular/core';
import {Observable, of} from 'rxjs';
import { Product } from './product';

@Injectable({
  providedIn: 'root'
})
export class ProductsService {

  constructor() { }

  getProducts(): Product[] {
    return [
      {
        name: 'Webcam',
        price: 100
      },
      {
        name: 'Microphone',
        price: 200
      },
      {
        name: 'Wireless keyboard',
        price: 85
      }
    ];
  }
}
